                    Hello
                </VisibleBottomDrawerStyle>
                :
                <NotVisibleBottomDrawerStyle>
                    Hello
                </NotVisibleBottomDrawerStyle>
            }
        </div>
    )
}

const VisibleBottomDrawerStyle = styled.div`

`

const NotVisibleBottomDrawerStyle = styled.div`
    display: none
`

export default BottomDrawer;
